 solutions and tests using a robust test framework. Additionally, the SWE-MERA leaderboard lets users choose issues from different time periods, making it easier to detect models affected by data contamination. Benchmarks like SWE-bench are designed to evaluate the ability of AI systems to solve issues from real repositories. Each task comes with a reference solution and a test patch that allows one to verify correctness of the solution: the tests in this patch should fail before the solution is applied and successfully pass afterwards. SWE-bench has become a standard for evaluating large language models (LLMs) on programming tasks, particularly through its SWE-bench/Lite and SWE-bench/Verified subsets. However, since the benchmark is static and both the tasks and their solutions are publicly available, the risk of data contamination increases."},va={ru:"Модель",eng:"Model"},ga={ru:"Позиция",eng:"Position"},Da={ru:"Задачи",eng:"Tasks"},xa={ru:"Ссылка",eng:"Trajectory"},_a={ru:"Данных за этот период нет",eng:"No data for this period"},Sa={header:wa,home:ua,leaderboard:ka,headerBlockFirst:Ca,textBlockFirst:ha,model:va,position:ga,tasks:Da,trajectory:xa,notExistedData:_a},yd=Object.freeze(Object.defineProperty({__proto__:null,default:Sa,header:wa,headerBlockFirst:Ca,home:ua,leaderboard:ka,model:va,notExistedData:_a,position:ga,tasks:Da,textBlockFirst:ha,trajectory:xa},Symbol.toStringTag,{value:"Module"})),d1=(e,a)=>Sa[e]?.[a]||"";var wd=M('<article class="description__text-wrapper svelte-1iptsqh"> </article>'),ud=M('<section class="description svelte-1iptsqh"><!></section>');function kd(e,a){Q1(a,!1);const d=oe("language");let c=X();const f=d.subscribe(t=>{g(c,t)});se(f),T1();var b=ud(),o=k(b);const r=d0(()=>d1("headerBlockFirst",n(c)));Qd(o,{get headerBlock(){return n(r)},children:(t,l)=>{var p=wd(),B=k(p);J(i=>K(B,i),[()=>d1("textBlockFirst",n(c))],d0),D(t,p)},$$slots:{default:!0}}),D(e,b),y1()}const Cd="modulepreload",hd=function(e,a){return new URL(e,a).href},Le={}
